import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <h1>CSV Converter</h1>
            <div className="links">
                <Link to='/homepage'>Home</Link>
                <Link to='/about'>About</Link>
                <Link to='/profile'>Profile</Link>
            </div>
        </nav>
     );
}
 
export default Navbar;
